localized.description:
Узнайте больше о «Сражении с Бурей» и наборе Робо-Лучика: https://www.epicgames.com/fortnite/save-the-world

За покупку этого набора вы получите доступ к режиму Fortnite «Сражение с Бурей»! Откройте для себя эпическую PvE-кампанию строительного боевика для совместного прохождения. Вам с друзьями предстоит обороняться от полчищ монстров и исследовать обширный разрушаемый мир, в котором каждого игрока ждут неповторимые приключения. Стройте огромные форты, создавайте оружие, собирайте добычу и развивайте героев!

Приобретая набор «Робо-Лучик», вы получите следующие бонусы:

– доступ к PvE-кампании «Сражение с Бурей»;
– герой Робо-Лучик;
– экипировка Робо-Лучика (для «Кор. битвы» и творч. режима);
– украшение «Инжектор СинеГеля» (для «Кор. битвы» и творч. режима);
– кирка «Разбиватель Лучика» (для «Кор. битвы» и творч. режима);
– испытания Робо-Лучика: получайте до 1000 В-баксов и рентген-билетов за выполнение заданий в СсБ.

Награды доступны после 1-й миссии штормового щита в СсБ.
